from collections import defaultdict


class Solution:

    def findTheDifference(self, s: str, t: str) -> str:
        # 统计每个字符串出现的次数，然后对比不同
        s_dict = dict()
        for si in s:
            sc = s.count(si)
            s_dict[si] = sc
        t_dict = dict()
        for ti in t:
            tc = t.count(ti)
            t_dict[ti] = tc
        for k in t_dict.keys():
            sv = s_dict.get(k, 0)
            tv = t_dict.get(k, 0)
            if sv != tv:
                return k

    def findTheDifference1(self, s: str, t: str) -> str:
        # 异或，每个数字异或它自己都会变成0，异或0都是它自己，两个字符串除了不同的那个字符其它都是偶数个
        r = 0
        for si in s:
            r ^= ord(si)
        for ti in t:
            r ^= ord(ti)
        return chr(r)

    def findTheDifference2(self, s: str, t: str) -> str:
        # 转unicode，相加再相减，再在转回字符串
        si = ti = 0
        for sk in s:
            si += ord(sk)
        for tk in t:
            ti += ord(tk)
        return chr(ti-si)

    def run(self):
        s = ""
        t = ""
        r = self.findTheDifference2(s, t)
        print(r)


s = Solution()
s.run()
